import React from 'react';
import { Routes, Route } from 'react-router-dom';
import LoginForm from './components/forms/LoginForm';
import Dashboard from './pages/Dashboard';
import { Professeurs, Etudiants, MesPfes, TousLesPfes, PfesEtudiants, Demandes, Domaines } from './pages';
function App() {
  return (
    <Routes>
      <Route path="/" element={<Dashboard />} />
      <Route path="/professeurs" element={<Professeurs />} />
      <Route path="/etudiants" element={<Etudiants />} />
        <Route path="/mes-pfes" element={<MesPfes />} />
        <Route path="/tous-les-pfes" element={<TousLesPfes />} />
        <Route path="/pfes-etudiants" element={<PfesEtudiants />} />
        <Route path="/demandes" element={<Demandes />} />
        <Route path="/domaines" element={<Domaines />} />
      <Route path="/login" element={<LoginForm />} />
    </Routes>
  );
}

export default App;
